import ContentLoader from "react-content-loader"
import ''

const CardLoader = () => (
  <div className = "card-loader-container">
  <ContentLoader 
    speed={2}
    width={300}
    height={300}
    viewBox="0 0 300 300"
    backgroundColor="#bbb"
    foregroundColor="#acebeb"
    >
    <rect x="48" y="300" rx="3" ry="3" width="300" height="6" /> 
    <rect x="-2" y="7" rx="3" ry="3" width="300" height="300" />
  </ContentLoader>
  </div>
)

export default CardLoader;
